import React from "react";

function star(value, req) {
  console.log(value, req);
  return (
    <span>
      <i
        class={
          value >= 1 + req
            ? "fa-solid fa-star"
            : value >= 0.5 + req
            ? "fa-regular fa-star-half-stroke"
            : "fa-regular fa-star"
        }
      ></i>
    </span>
  );
}

const Rating = ({ value, text }) => {
  return (
    <div className="rating">
      {[0, 1, 2, 3, 4].map((j) => {
        {
          star(value, j);
        }
      })}

      {star(value, 1)}
      {star(value, 2)}
      {star(value, 3)}
      {star(value, 4)}

      <span> {text && text} </span>
    </div>
  );
};

export default Rating;
